import React from "react";
import HairBtn from "./HairBtn";

export default function Hair({handleHair}) {
    const imgbtns = []
    for (let i = 1; i < 74; i++) {
        const url = `character/hair/${i}.png`;
        imgbtns.push(<HairBtn url={url} handleChange={() => handleHair(url)}/>); 
    }
    return (
        <div class="container">
            <h3>HAIR</h3>
            <div class="eachHair">{imgbtns}</div>
        </div>
    )
}
